#import <XCTest/XCTest.h>
#import "TopChartAlbumsBuilder.h"
#import "AlbumMeta.h"

@interface TopChartAlbumBuilderTests : XCTestCase

@end

@implementation TopChartAlbumBuilderTests

- (void)setUp {
    [super setUp];
    // Put setup code here. This method is called before the invocation of each test method in the class.
}

- (void)tearDown {
    // Put teardown code here. This method is called after the invocation of each test method in the class.
    [super tearDown];
}

- (void)testIllegalInit {
    XCTAssertThrows([[TopChartAlbumsBuilder alloc] initWithJSONObjectFromItunes:nil]);
}

- (void)testWithItunesData {
    NSDictionary *objects = [self testJSONObject];
    TopChartAlbumsBuilder *builder = [[TopChartAlbumsBuilder alloc] initWithJSONObjectFromItunes:[self testJSONObject]];
    
    XCTAssertEqual(builder.topChartAlbums.count, 20);
    for (id item in builder.topChartAlbums) {
        XCTAssertTrue([item isKindOfClass:[AlbumMeta class]]);
    }
}

- (NSDictionary *)testJSONObject {
    NSData *data = [[self testJSONString] dataUsingEncoding:NSUTF8StringEncoding];
    return [NSJSONSerialization JSONObjectWithData:data options:NSJSONReadingAllowFragments error:NULL];
}

